{"3": ["Это одно из лучших приобретений на WB. Мне часики очень понравились, выглядят достойно, дорого. Цена для таких часов смешная 3490р. Пришла без подарочной коробки, но мне не принципиально, т.к. брала для себя. Надеюсь дальше будут радовать и не подведут мои, теперь уже любимые часики.", "2019-10-01T15:15:47.886597212Z", "серебристый", "19", 3, 0, 5, "Часы", "Teosa"], "4": ["пришли без фирменной упаковки в простом пакете, но поэтому они видимо и с такой большой скидкой, прекрасные нежные сияющие часики, украшают запястье, замочек удобный и добротный, конечно их отрицательные качества покажет только время, на момент покупки всем довольна, брала 19 размер, не болтаются и не жмут, спасибо", "2019-09-06T06:48:43.016409808Z", "серебристый", "19", 1, 0, 5, "Часы", "Teosa"], "5": ["Часы очень красивые, достались за 3600р. Просто нереальная скидка.\nЯ очень надеюсь что они качественные и прослужат долго.", "2019-05-26T12:31:19.394930931Z", "серебристый", "19", 7, 2, 5, "Часы", "Teosa"], "7": ["Часы очень красивые, покупала к комплекту. Полностью браслет серебряный, я очень довольна , спасибо!", "2019-04-09T12:28:22.598751312Z", "серебристый", "19", 4, 0, 5, "Часы", "Teosa"], "8": ["Часы очень красивые, аккуратно сделаны, но отказ в связи с размером(", "2019-03-31T05:00:29.681582669Z", "серебристый", "18", 1, 3, 3, "Часы", "Teosa"], "9": ["Часики красивые, но к сожалению не было подарочной упаковки", "2019-03-11T16:11:19.506282318Z", "серебристый", "19", 3, 0, 5, "Часы", "Teosa"], "10": ["Отличные часики, легкие, красивые. Камешки слегка мерцают. На руке смотрятся прекрасно.", "2018-10-19T18:32:23.405269516Z", "серебристый", "18", 5, 1, 5, "Часы", "Teosa"], "11": ["Неплохие часики. Даже с паспортом и штамп магазина поставили.", "2018-10-16T14:11:03.58691498Z", "серебристый", "19", 5, 0, 5, "Часы", "Teosa"]}
